import { ListItemIcon, ListItem, Button, List, ListItemButton, ListItemText, ListSubheader, ThemeProvider, createTheme } from "@mui/material";
import React from "react";
import HandymanIcon from '@mui/icons-material/Handyman';

import "./ControlPanel.css"

const theme = createTheme({

    palette: {
        primary: {
            main: '#FEB130',
        },
        secondary: {
            main: '#ff80ab',
        },
    },
})

const ControlPanel = () => {
    const Feature = ["Driving", "Tuning", "Color Selector"]
    return (
        <List className="Navigator" variant="outlined">
            <ListItem style={{ width: "100%", display: "flex", verticalAlign: "middle" }}><HandymanIcon /></ListItem>
            {/* < */}
            {Feature.map((i) => {
                return (
                    <ListItem style={{ "width": "fill-available" }} key={i}>
                        <ListItemButton color='primary' href="#simple-list" >
                            <ListItemText color="primary" primary={i} />
                        </ListItemButton>
                    </ListItem>
                )
            })}
        </List >
        // </ThemeProvider >

    );
}

export default ControlPanel
